import { Container, Grid } from '@material-ui/core'
import React from 'react'
import AllPosts from './AllPosts'

class HomePageComponent extends React.Component{
    render(){
        return(
            <Container>
                <Grid container spacing={2}>
                    <Grid item xs={12}>
                        <AllPosts></AllPosts>
                    </Grid> 
                </Grid>
            </Container>
        )
    }
}

export default HomePageComponent
